import Expenses from "./components/Expenses";
import "./components/ExpenseDate.css";

function App() {
  const expenses = [
    {
      title: "WoW Subscription",
      amount: 12.99,
      date: new Date(2021, 5, 5),
    },
    {
      title: "Dota Skin",
      amount: 12.99,
      date: new Date(2021, 4, 5),
    },
    {
      title: "CSGO Gamble Loss",
      amount: 12.99,
      date: new Date(2021, 4, 5),
    },
    {
      title: "Gym",
      amount: 12.99,
      date: new Date(2021, 4, 5),
    },
  ];

  return (
    <div className="expenses">
      <h1>Let's get started</h1>
      <Expenses className="expenses" array={expenses} />
    </div>
  );
}

export default App;
